import './App.css';
import Navbar from './components/Navbar';
import Card from './components/Card';
import placesData from './assets/placesData';
import axios from 'axios';

function App() {

  const visitedPlaces = placesData.map(visit => 
    <Card
      key={visit.id}
      {...visit}
    />  
  )

  return (
    <div>
      <Navbar/>
      {visitedPlaces}
    </div>
  );
}

export default App;
